import React from 'react';
import Link from 'next/link';
import AppLayout from '../components/Applayout';

const Home = () => {
    return (
        <>
            <AppLayout>
                <p><Link href="/"><a>home</a></Link></p>
                <p><Link href="/about"><a>about</a></Link></p>
                <p><Link href="/user/create"><a>create</a></Link></p>
                <div>Hello, Next!</div>
            </AppLayout>        
        </>
    );
}

export default Home;
